import React from "react";

const BookDetails = ({bookData}) => {
  const {title, author, synopsis}= bookData[0];
  return (
    <main>
      <h4>{title}</h4>
      <h4>{author}</h4>
      <h1>{synopsis}</h1>
    </main>
  );
};

export default BookDetails;
